import React from "react";

function Chat() {
  return (
    <div className="chat">
      <div className="chatinfo">
        <span>dogesh </span>
        <div className="chatIcons"></div>

        <img src={Cam} alt=""/>
        <img src={ADD} alt=""/>
        <img src={More} alt=""/>
      </div>
    </div>
  );
}

export default Chat;
